import React, {useState, useEffect} from 'react'
import './taskbar.scss'
import { Redirect  } from 'react-router-dom';
import { Navbar, Nav, Container } from 'react-bootstrap';

const Taskbar = () => {

    const [loggedIn, setIsLoggedIn] = useState();
    
    let token;
    
    function App() {
        useEffect(() => {
            token = localStorage.getItem("token")
            if (!token) {
                setIsLoggedIn(false)
            }
            else {
                setIsLoggedIn(true)
            }
        }, []);
    } 
    App();
    const logout = (e) => {
        if(loggedIn)
        {
        localStorage.removeItem("token")
        localStorage.removeItem("name")
        console.log("called")
        return (
            <Redirect to="users"/>
        )
        
        }
        
    }

    return(
        <div className="taskbar">
            <Navbar bg="danger" expand="lg" >
               <Container >
               <Nav className="me-auto">
                    <Nav.Link style={{ paddingLeft: "60px"}} href="/demo" onClick={logout}>{loggedIn? 'Logout': 'Login'}</Nav.Link>
                    {loggedIn &&<Nav.Link style={{ paddingLeft: "100px"}} href="/profile">My Profile</Nav.Link>}
                    <Nav.Link style={{ paddingLeft: "100px"}} href="admin">Admins</Nav.Link>
                    <Nav.Link style={{ paddingLeft: "100px"}} href="/myservices">My Services</Nav.Link>
                    <Nav.Link style={{ paddingLeft: "100px"}} href="/police_stations">Police Stations</Nav.Link>
                    <Nav.Link style={{ paddingLeft: "100px"}} href="/fire_services">Fire Services</Nav.Link>
                    <Nav.Link style={{ paddingLeft: "100px"}} href="/get_service">Get Services</Nav.Link>
                </Nav>
               </Container>
            </Navbar>
        </div>
        
    )
}

export default Taskbar
